(539, 1, 45, 'What experience is most relevant to the position you are applying for?', 'I have expierence as Engineer Tech III with Spectra-Physics and am now employed with Dilas Lasers as Laser Technician II. I have worked with single fiber lasers, BTS Lensed diode bars, and also fiber coupled with Hybrid Optical Chip.', 'Application Process', 'Application Process', '2008-09-09 19:47:57'),
