(555, 1, 49, 'What experience is most relevant to the position you are applying for?', 'I''ve worked in a test environment with electronic engineers at Texas Instruments.  Granted the voltages aren''t anything close to what Applied Energetics deals with.  I also worked on the C-130 aircraft E-4 Autopilot test bench which required 240 VAC input', 'Application Process', 'Application Process', '2008-09-25 02:35:00'),
(556, 1, 49, 'What do you want to do at Applied Energetics?', 'I''d like to start out in the test and operational evaluation of directed energy systems.  I''m also very much interested in providing field support and/or training to military units employing directed energy systems, especially the Counter-IED program.', 'Application Process', 'Application Process', '2008-09-25 02:35:00'),
