(562, 1, 47, 'What experience is most relevant to the position you are applying for?', 'I have done opto-mechanical design for two laser-based systems, the 3 to 4W sodium laser guide star system (dye laser) for the Multiple Mirror Telescope, and the Etec Polyscan laser direct imaging system for PCB manufacturing. I have been involved in ever', 'Application Process', 'Application Process', '2008-09-25 21:31:04'),
(563, 1, 47, 'What do you want to do at Applied Energetics?', 'I would like to be involved in yhe opto-mechanical design, the fabrication and the testing of your laser systems.', 'Application Process', 'Application Process', '2008-09-25 21:31:04'),
