(945, 'Copy of CATS 2.0', 1, 'Header', '<div id="container">\r\n	<br>\r\n        <div id="logo"><img src="images/aesiglogo.png" alt="IMAGE: Applied Energetics Applicant Tracking System Careers Page" /> </div>\r\n    <div id="actions">\r\n              \r\n<center><a href="index.php?m=careers&p=showAll" onmouseover="buttonMouseOver(''showAllJobs'',true);" onmouseout="buttonMouseOver(''showAllJobs'',false);"><img src="images/careers_show.gif" id="showAllJobs" alt="IMAGE: Show All Jobs" /></a></center>\r\n<br>\r\n<br>\r\n<center><ul><a href="Http://www.appliedenergetics.com">Visit Applied Energetics Website</a></ul></center>\r\n<br/>	\r\n    </div>'),
(946, 'Copy of CATS 2.0', 1, 'Content - Main', '<div id="careerContent">\r\n        <registeredCandidate>\r\n        <h1>Available Openings at <siteName></h1>\r\n        <div id="descriptive">\r\n               <p>"Throughout your career, you will be challenged by the work and by the people on your team, \r\n                  as well as by the clients we serve. Become part of an organization that is committed to serve\r\n                  and protect our countrys critical infrastructure." </p>\r\n                <p>We currently have <numberOfOpenPositions> positions open!</p>\r\n               <p><font size="4">Proceed to the postings <a href="index.php?m=careers&p=showAll">HERE</a>.</font></p><br /><br /><registeredLoginTitle><font size="4">Users with logins can login below!</font></registeredLoginTitle><registeredLogin>\r\n        </div>\r\n        \r\n</div>'),
(955, 'Copy of CATS 2.0', 1, 'CSS', 'table.sortable\r\n{\r\ntext-align:left;\r\nempty-cells: show;\r\nwidth: 940px;\r\n}\r\ntd\r\n{\r\npadding:5px;\r\n}\r\ntr.rowHeading\r\n{\r\n background: #e0e0e0; border: 1px solid #cccccc; border-left: none; border-right: none;\r\n}\r\ntr.oddTableRow\r\n{\r\nbackground: #ebebeb; \r\n}\r\ntr.evenTableRow\r\n{\r\n background: #ffffff; \r\n}\r\na.sortheader:hover,\r\na.sortheader:link,\r\na.sortheader:visited\r\n{\r\ncolor:#000;\r\n}\r\n\r\nbody, html { margin: 0; padding: 0; background: #ffffff; font: normal 12px/14px Arial, Helvetica, sans-serif; color: #000000; }\r\n#container { margin: 0 auto; padding: 0; width: 940px; height: auto; }\r\n#logo { float: left; margin: 0; }\r\n	#logo img { width: 247px; height: 69px; }\r\n#actions { float: right; margin: 0; width: 310px; height: 100px; background: #efefef; border: 1px solid #cccccc; }\r\n	#actions img { float: left; margin: 2px 6px 2px 15px; width: 130px; height: 25px; }\r\n#footer { clear: both; margin: 20px auto 0 auto; width: 150px; }\r\n	#footer img { width: 137px; height: 38px; }\r\n\r\na:link, a:active { color: #1763b9; }\r\na:hover { color: #c75a01; }\r\na:visited { color: #333333; }\r\nimg { border: none; }\r\n\r\nh1 { margin: 0 0 10px 0; font: bold 18px Arial, Helvetica, sans-serif; }\r\nh2 { margin: 8px 0 8px 15px; font: bold 14px Arial, Helvetica, sans-serif; }\r\nh3 { margin: 0; font: bold 14px Arial, Helvetica, sans-serif; }\r\np { font: normal 12px Arial, Helvetica, sans-serif; }\r\np.instructions { margin: 0 0 0 10px; font: italic 12px Arial, Helvetica, sans-serif; color: #666666; }\r\n\r\n\r\n/* CONTENTS ON PAGE SPECS */\r\n#careerContent { clear: both; padding: 15px 0 0 0; }\r\n\r\n	\r\n/* DISPLAY JOB DETAILS */\r\n#detailsTable { width: 400px; }\r\n	#detailsTable td.detailsHeader { width: 30%; }\r\ndiv#descriptive { float: left; width: 585px; }\r\ndiv#detailsTools { float: right; padding: 0 0 8px 0; width: 280px; background: #ffffff; border: 1px solid #cccccc; }\r\n	div#detailsTools img { margin: 2px 6px 5px 15px;  }\r\n\r\n/* DISPLAY APPLICATION FORM */\r\ndiv.applyBoxLeft, div.applyBoxRight { width: 450px; height: 470px; background: #f9f9f9; border: 1px solid #cccccc; border-top: none; }\r\ndiv.applyBoxLeft { float: left; margin: 0 10px 0 0; }\r\ndiv.applyBoxRight { float: right; margin: 0 0 0 10px; }\r\n	div.applyBoxLeft div, div.applyBoxRight div { margin: 0 0 5px 0; padding: 3px 10px; background: #efefef; border-top: 1px solid #cccccc; border-bottom: 1px solid #cccccc; }\r\n	div.applyBoxLeft table, div.applyBoxRight table { margin: 0 auto; width: 420px; }\r\n	div.applyBoxLeft table td, div.applyBoxRight table td { padding: 3px; vertical-align: top; }\r\n		td.label { text-align: right; width: 110px; }\r\n        form#applyToJobForm {  }\r\n	form#applyToJobForm label { font-weight: bold; }\r\n	form#applyToJobForm input.inputBoxName, form#applyToJobForm input.inputBoxNormal { width: 285px; height: 15px; }\r\n        form#applyToJobForm input.submitButton { width: 197px; height: 27px; background: url(''images/careers_submit.gif'') no-repeat; }\r\n\r\n        form#applyToJobForm input.submitButtonDown { width: 197px; height: 27px; background: url(''images/careers_submit-o.gif'') no-repeat; }\r\n	form#applyToJobForm textarea { margin: 8px 0 0 0; width: 410px; height: 170px; }\r\n	form#applyToJobForm textarea.inputBoxArea{ width: 285px; height: 70px; }\r\n\r\n'),
(947, 'Copy of CATS 2.0', 1, 'Content - Search Results', '<div id="careerContent">\r\n        <registeredCandidate>\r\n        <h1>Current Available Openings, Recently Posted Jobs: <numberOfSearchResults></h1>\r\n<searchResultsTable>\r\n    </div>'),
(952, 'Copy of CATS 2.0', 1, 'Content - Questionnaire', '<div id="careerContent">\r\n<questionnaire>\r\n<br /><br />\r\n<div style="text-align: right;">\r\n<submit value="Continue">\r\n</div>\r\n</div>'),
(948, 'Copy of CATS 2.0', 1, 'Content - Job Details', '<div id="careerContent">\r\n        <registeredCandidate>\r\n        <h1>Position Details: <title></h1>\r\n        <table id="detailsTable">\r\n            <tr>\r\n                <td class="detailsHeader"><strong>Location:</strong></td>\r\n                <td><city>, <state></td>\r\n			</tr>\r\n			<tr>\r\n                <td class="detailsHeader"><strong>Openings:</strong></td>\r\n                <td><openings></td>\r\n			</tr>\r\n            <tr>\r\n                <td class="detailsHeader"><strong>Salary Range:</strong></td>\r\n                <td><salary></td>\r\n            </tr>\r\n        </table>\r\n        <div id="descriptive">\r\n            <p><strong>Description:</strong></p>\r\n            <description>\r\n		</div>\r\n        <div id="detailsTools">\r\n        	<h2>Perform an action:</h2>\r\n        	<a-applyToJob onmouseover="buttonMouseOver(''applyToPosition'',true);" onmouseout="buttonMouseOver(''applyToPosition'',false);"><img src="images/careers_apply.gif" id="applyToPosition" alt="IMAGE: Apply to Position" /></a>\r\n        </div>\r\n    </div>'),
(953, 'Copy of CATS 2.0', 1, 'Content - Thanks for your Submission', '<div id="careerContent">\r\n            <h1>Application Submitted For: <title></h1>\r\n            <div id="descriptive">\r\n                <p>Please check your email inbox &#8212; You should receive an email confirmation of your application.</p>\r\n                <p>Thank you for submitting your application to us. We will review it shortly and make contact with you soon.</p>\r\n                </div>\r\n			<div id="detailsTools">\r\n                <h2>Perform an action:</h2>\r\n                <ul>\r\n                	<li><a href="">Visit our website</a></li>\r\n		</ul>\r\n        	</div>\r\n    </div>'),
(949, 'Copy of CATS 2.0', 1, 'Content - Candidate Registration', '<div id="careerContent">\r\n    <h1><applyContent>Applying to <title></applyContent></h1>\r\n    <center>\r\n    <table cellpadding="0" cellspacing="0">\r\n        <tr>\r\n            <td><label id="emailLabel" for="email">Enter your e-mail address:</label></td>\r\n            <td><input-email></td>\r\n        </tr>\r\n        <tr>\r\n            <td align="right" valign="top"><input-new></td>\r\n            <td style="line-height: 18px;">\r\n                <applyContent>\r\n                <strong>I have not registered on this website.</strong><br />\r\n                (I haven''t applied to any jobs online)\r\n                </applyContent>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align="right" valign="top"><input-registered></td>\r\n            <td style="line-height: 20px;">\r\n                <strong>I have registered before</strong><br />\r\n                and my last name is:<br />\r\n                <input-lastName><br />\r\n                and my zip code is:<br />\r\n                <input-zip><br /><br />\r\n                <input-rememberMe> Remember my information for future visits<br /><br />\r\n                <input-submit><br /><br />\r\n            </td>\r\n        </tr>\r\n    </table>\r\n    </center>\r\n</div>\r\n'),
